window.bookSummaryJSON = "<p><b>An Elondrian ambassador and his wife are kidnapped by the overlord of Cylmar, and Ayrion finds himself being whisked away in the middle of the night to save them.</b></p> <p>Not even given the chance to tell his tribe that he is being sent on a secret mission, Ayrion and Room Eleven find themselves being forced to sneak behind enemy lines.</p> <p>Unfortunately, as Ayrion’s luck usually holds, nothing goes according to plan.</p> <p>With this being Ayrion’s first time to lead a mission, he doesn’t want to fail, but the deeper into enemy territory they get, the more likely that outcome becomes.</p> <p><b>Warning: </b><i>There are a couple of darker scenes in this book from the previous four as Ayrion now reaches his late teens.</i></p>"; 
